INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES ("このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", "エリコ（バレンタイン）", 2, 8.0, 2, "2030/12/17 14:59:59", 10011, 5.0, 24002, 1, 0, 109001, "2019/01/31 12:00:00", 24, -385.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES ("あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", "エリコ（バレンタイン）", 3, 8.0, 2, "2030/12/17 14:59:59", 10011, 10.11, 24003, 1, 0, 109001, "2019/01/31 12:00:00", 24, -385.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES ("あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", "エリコ（バレンタイン）", 4, 8.0, 2, "2030/12/17 14:59:59", 10011, 4.0, 24004, 1, 0, 109001, "2019/01/31 12:00:00", 24, -385.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES ("今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", "エリコ（バレンタイン）", 5, 8.0, 2, "2030/12/17 14:59:59", 10011, 6.0, 24005, 1, 0, 109001, "2019/01/31 12:00:00", 24, -385.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES ("あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", "エリコ（バレンタイン）", 6, 0.0, 1, "2030/12/17 14:59:59", 10011, 0.0, 24006, 1, 0, 109002, "2019/01/31 12:00:00", 24, 0.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES ("とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", "エリコ（バレンタイン）", 7, 0.0, 1, "2030/12/17 14:59:59", 10011, 0.0, 24007, 1, 0, 109002, "2019/01/31 12:00:00", 24, 0.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES ("私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", "エリコ（バレンタイン）", 8, 0.0, 1, "2030/12/17 14:59:59", 10011, 0.0, 24008, 1, 0, 109002, "2019/01/31 12:00:00", 24, 0.0);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES ("あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", "エリコ（バレンタイン）", 9, 0.0, 1, "2030/12/17 14:59:59", 10011, 0.0, 24009, 1, 0, 109002, "2019/01/31 12:00:00", 24, 0.0);
